# -*- coding: UTF-8 -*-
import re
import os
from bs4 import BeautifulSoup
from typing import List


# 把html檔案裡的檔名提取出來
def get_html_name_list(html_doc: str) -> List[str]:
    html_li = []
    soup = BeautifulSoup(html_doc, 'html.parser')
    title_tag = soup.find_all("td", class_="title")
    for td in title_tag:
        html_name = td.text
        html_li.append(html_name)
    return html_li


# 把mp3檔案裡的檔名提取出來
def get_file_name_list() -> List[str]:
    file_li = []
    dir = "eng_mp3"
    for root, dirs, files in os.walk(dir):
        for file_name in files:
            file_li.append(file_name)

    return file_li


# 比對檔名是否一致
def match(html_name: str, file_name: str) -> bool:
    pattern = re.compile(r"(\w+)", re.A)
    html_eng_li = pattern.findall(html_name)
    file_eng_li = pattern.findall(file_name[:-12])

    pass_count = 0
    for file_name_element in file_eng_li:
        if file_name_element in html_eng_li:
            pass_count += 1
    if pass_count >= len(file_eng_li) - 1:
        if len(file_eng_li) == 0:
            return False
        return True
    return False


# 確認html檔名是否存在file name list裡
def find_file_name(html_name: str, file_list: List[str]) -> bool:
    for file_name in file_list:
        if match(html_name, file_name):
            return True
    else:
        return False


